import React from "react";
import project01 from "../photo/project01.png";
import project02 from "../photo/project02.png";
import project03 from "../photo/project03.png";
import "../style/project.css";

function Project() {
  return (
    <div className="container">
      <h1>Project</h1>
      <marquee>
      <div className=" projects " >
      <div className="first  project">

        <img className="image" src={project01} alt="photo" />
        <h3> My Portfolio</h3>
        <p> Technology Used - React </p>
        <button className=" projectbtn">View</button>
        <button className=" projectbtn">Code</button>
      </div>
      <div className="second project">
        <img className="image" src={project02} />
        <h3> Ticket Booking app</h3>
        <p>
          {" "}
          Technology Used - React ,React-redux , and add a functionalty of timer
          if the time over the user is navigated to home page{" "}
        </p>
        <button className=" projectbtn">View</button>
        <button className=" projectbtn">Code</button>
      </div>
      <div className="third project">
        <img className="image" src={project03} />
        <h3> Thali bookin app </h3>
        <p> Technology Used - React ,React-redux </p>
        <button className=" projectbtn">View</button>
        <button className=" projectbtn">Code</button>
      </div>
      </div>
      </marquee>
    </div>
  );
}

export default Project;
